		    	log.info("### " + numeroRF);
			    var constraints = [];
			    constraints.push(DatasetFactory.createConstraint("processAttachmentPK.processInstanceId", numeroRF, numeroRF, ConstraintType.MUST));	
				var dataset = DatasetFactory.getDataset("processAttachment", null, constraints, null);	
				log.info("### dataset.rowsCount: " + dataset.rowsCount);
				if(dataset != null && dataset.rowsCount > 0){
					for (var j = 0; j < dataset.rowsCount; j++){
						hAPI.attachDocument(dataset.getValue(j, 'documentId'));
					}
				} else {
					log.warn("### Não há anexos para importar");
				}
		    }
