function afterProcessCreate(processId){
	hAPI.setCardValue("numeroFluxo", processId);
	hAPI.setCardValue("dataCriacao", obterDataCorrente());
	hAPI.setCardValue("situacao", "Em aberto");
	hAPI.setCardValue("idSolicitacao", "FDR - " + processId);
}

function beforeCancelProcess(colleagueId, processId) {
    log.warn("#### SOLICITACAO DE CANCELAMENTO DA SOLICITACAO " + processId);
    
    var numeroRF = hAPI.getCardValue("numeroRF");
    var statusSolicitacoes = validaStatusRFs(numeroRF);

    log.info("#### STATUS DAS SOLICITAÇÕES:");
    log.dir(statusSolicitacoes);
    
    if (statusSolicitacoes == "noResult") {
        hAPI.setCardValue("dataFinalizacao", obterDataCorrente());
        hAPI.setCardValue("situacao", "Cancelado");
    } else {
        var listaSolicitacoes = statusSolicitacoes.map(function(solicitacao) {
            return "<b>RF:</b> " + solicitacao.numeroRF + " | <b>Status:</b> " + (solicitacao.status == "0" ? "Aberto" : "Finalizado");
        }).join("<br>");
        
        throw "<br><br>" +
              "<b>Não é possível cancelar a solicitação.</b><br><br>" +
              "O processo de RF está vinculado a estas solicitações: <br>" + 
              listaSolicitacoes + "<br><br>" +
              "Favor realizar o cancelamento das solicitações listadas antes de prosseguir.<br><br>" +
              "Dúvidas? Entre em contato com o departamento de TI.<br><br>";
    }
}

function obterDataCorrente(){
	var dateCorrente = new Date();
	var formatoData = new java.text.SimpleDateFormat("dd/MM/yyyy HH:mm:ss");
	return formatoData.format(dateCorrente);
}

function validaStatusRFs(numeroRFs) {
    log.info("### INICIO # validaStatusRFs");

    var statusSolicitacoes = [];
    
    if (numeroRFs == "") {
        return "noResult";
    }

    var numerosRFSplit = numeroRFs.split(',');
    
    for (var i = 0; i < numerosRFSplit.length; i++) {
        var numeroRF = numerosRFSplit[i].trim(); // Remove espaços em branco
        var constraints = [];
        constraints.push(DatasetFactory.createConstraint("workflowProcessPK.processInstanceId", numeroRF, numeroRF, ConstraintType.MUST));
        var dataset = DatasetFactory.getDataset("workflowProcess", null, constraints, null);
        
        if (dataset != null && dataset.rowsCount > 0) {
            var status = dataset.getValue(0, 'status');
            if (status == "0" || status == "2") {
                statusSolicitacoes.push({
                    numeroRF: numeroRF,
                    status: status
                });
            }
        }
    }
    
    if (statusSolicitacoes.length > 0) {
        return statusSolicitacoes;
    } else {
        return "noResult";
    }
}

