function currencyToNumber(numero){
	if(numero != null && numero != undefined && numero != ''){
        return parseFloat(numero.replace(".","").replace(",","."));
	}else{
		return 0
	}
}

function numberToCurrency(numero) {
    var numero = parseFloat(numero).toFixed(2).split('.');
    numero[0] = numero[0].split(/(?=(?:...)*$)/).join('.');
    return numero.join(',');
}

function obterDataCorrente(){
	var dateCorrente = new Date();
	var formatoData = new java.text.SimpleDateFormat("dd/MM/yyyy HH:mm:ss");
	return formatoData.format(dateCorrente);
}

function intermediateconditional141() {
	log.info("###### intermediateconditional141() INICIO");

	var processo = getValue("WKNumProces");
    var numeroRF = hAPI.getCardValue("numeroRF");
    var resultado = validaStatusRF(); // Chama a função de validação
    log.info("### RESULTADO DETALHADO ###");
    log.dir(resultado);

    var todasFinalizadas = true;
    var algumaCancelada = false;
    var algumaAberta = false;
    var algumaNaoEncontrada = false;

    // Avalia o resultado detalhado e aplica comentários individuais
    for (var i = 0; i < resultado.length; i++) {
        var item = resultado[i];
        var numero = item.numeroRF;
        var status = item.status;

        if (status == "noResult") {
        	log.info("#### " + numero + " " + "noResult");
            algumaNaoEncontrada = true;
            hAPI.setTaskComments("admin", processo, 0, '<p><u><span style="color:#e74c3c;">RF ' + numero + ' NÃO ENCONTRADA.</span></u></p>');
        } else if (status == "1") {
        	log.info("#### " + numero + " " + "1");
            algumaCancelada = true;
            hAPI.setTaskComments("admin", processo, 0, '<p><u><span style="color:#e74c3c;">RF ' + numero + ' CANCELADA.</span></u></p>');
        } else if (status != "2") {
        	log.info("#### " + numero + " " + "!= 2");
            algumaAberta = true;
            todasFinalizadas = false;
        }
    }

    log.info("### RESULTADOS CONDICIONAL: ");
    log.info("### algumaNaoEncontrada: " + algumaNaoEncontrada);
    log.info("### algumaAberta: " + algumaAberta);
    log.info("### algumaCancelada: " + algumaCancelada);
    log.info("### todasFinalizadas: " + todasFinalizadas);

    // Determina o retorno com base nos flags
    if (algumaNaoEncontrada || algumaCancelada) {
        return true;
    } else if (algumaAberta) {
        return false;
    } else if (todasFinalizadas) {
        return true;
    } else {
        return false;
    }
}


function validaStatusRF() {
    log.info("###INICIO#validaStatusRF()");

    var numeroRF = hAPI.getCardValue("numeroRF");
    var statusDetalhado = []; // Array para armazenar o número e status de cada solicitação

    if (numeroRF === "") {
        return statusDetalhado; // Retorna um array vazio se não houver números de solicitação
    } else {
        var numerosRFSplit = numeroRF.split(',');

        for (var i = 0; i < numerosRFSplit.length; i++) {
        	var numeroRF = numerosRFSplit[i].trim(); // Remove espaços em branco
            var constraints = [];
            constraints.push(DatasetFactory.createConstraint("workflowProcessPK.processInstanceId", numeroRF, numeroRF, ConstraintType.MUST));    
            var dataset = DatasetFactory.getDataset("workflowProcess", null, constraints, null);
            log.info(dataset);

            var status;
            if (dataset == null || dataset.rowsCount < 1) {
                status = "noResult";
            } else if (dataset.rowsCount > 0) {
                status = dataset.getValue(0, 'status');
            } else {
                status = "null";
            }

            // Adiciona um objeto ao array com o número da solicitação e o status
            statusDetalhado.push({
                numeroRF: numerosRFSplit[i],
                status: status
            });
        }

        return statusDetalhado;
    }
}

function validaStatusGateway(){
    log.info("### INICIO # validaStatusGateway()");

    var statusDetalhado = validaStatusRF();
    var algumaNaoEncontrada = false;
    var algumaAberta = false;
    var temSolicitacaoCancelada = false;
    var todasFinalizadas = true;


    for (var i = 0; i < statusDetalhado.length; i++) {
        var item = statusDetalhado[i];
        var status = item.status;

        if (status == "noResult") {
            algumaNaoEncontrada = true;
        } else if (status == "1") {
            temSolicitacaoCancelada = true;
            todasFinalizadas = false;
        } else if (status == "0") {
            algumaAberta = true;
            todasFinalizadas = false;
        }
    }

    log.info("### RESULTADOS GATEWAY: ");
    log.info("### algumaNaoEncontrada: " + algumaNaoEncontrada);
    log.info("### algumaAberta: " + algumaAberta);
    log.info("### temSolicitacaoCancelada: " + temSolicitacaoCancelada);
    log.info("### todasFinalizadas: " + todasFinalizadas);

    if (todasFinalizadas) {
    	log.info("### todasFinalizadas - 2");
        return 2; // Todas as solicitações estão finalizadas
    } else if (algumaNaoEncontrada) {
    	log.info("### todasFinalizadas - noResult");
        return "noResult"; // Há solicitações não existentes
    } else if (temSolicitacaoCancelada) {
    	log.info("### temSolicitacaoCancelada - 1");
        return 1; // Há solicitações canceladas
    } else {
    	return false;
    }
}


